INSERT INTO `table_seo` VALUES (469, 52, 'news', 'man', 'dich-vu', 'Nơi lắp đặt trạm biến áp chuyên nghiệp giá tốt', 'nơi lắp đặt trạm biến áp chuyên nghiệp giá tốt', 'Doanh nghiệp có thể lựa chọn nơi lắp đặt trạm biến áp chuyên nghiệp giá tốt hợp lý. Mà vẫn đảm bảo chất lượng và hiệu quả sử dụng của sản phẩm.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (470, 53, 'news', 'man', 'dich-vu', 'Công ty lắp đặt trạm biến áp uy tín tại Bình Dương', 'công ty lắp đặt trạm biến áp', 'Dưới đây là một số công nghệ mới trong lắp đặt trạm biến áp. Và công ty lắp đặt trạm biến áp tại Bình Dương có thể bạn cần.', NULL, NULL, NULL, NULL, NULL);
