INSERT INTO `table_seo` VALUES (860, 443, 'news', 'man', 'dich-vu', 'Công ty chuyên bảo trì trạm biến áp uy tín mà bạn không nên bỏ qua', 'công ty chuyên bảo trì trạm biến áp', 'Khôi Việt Phát là công ty chuyên bảo trì trạm biến áp với đội ngũ nhân viên được đào tạo chuyên sâu, giàu kinh nghiệm được nhiều khách hàng tin tưởng.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (861, 444, 'news', 'man', 'dich-vu', 'Tìm kiếm địa chỉ chuyên bảo trì trạm biến áp uy tín chất lượng', 'địa chỉ chuyên bảo trì trạm biến áp', 'Khôi Việt Phát - địa chỉ chuyên bảo trì trạm biến áp uy tín với nhiều năm kinh nghiệm thi công và bảo trì được nhiều doanh nghiệp tin tưởng lựa chọn.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (862, 445, 'news', 'man', 'dich-vu', 'Đơn vị chuyên cung cấp dịch vụ bảo trì trạm biến áp tại Long An', 'bảo trì trạm biến áp tại Long An', 'Nếu bạn có nhu cầu tìm nơi bảo trì trạm biến áp tại Long An uy tín, thì Khôi Việt Phát là nơi bạn không nên bỏ lỡ. Xem ngay bài viết để biết thêm thông tin.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (863, 446, 'news', 'man', 'dich-vu', 'Đơn vị chuyên thi công bảo trì trạm biến áp giá rẻ uy tín', 'bảo trì trạm biến áp giá rẻ', 'Khôi Việt Phát là một trong những đơn vị bảo trì trạm biến áp giá rẻ chuyên nghiệp được nhiều nhà máy lớn nhỏ lựa chọn tin tưởng trong nhiều năm qua.', NULL, NULL, NULL, NULL, NULL);
