INSERT INTO `table_seo` VALUES (977, 560, 'news', 'man', 'dich-vu', 'Công ty chuyên bảo dưỡng sửa chữa trạm biến áp uy tín hàng đầu', 'bảo dưỡng sửa chữa trạm biến áp', 'Trên thị trường có nhiều đơn vị cung cấp dịch vụ bảo dưỡng sửa chữa trạm biến áp tuy nhiên nếu bạn muốn tìm kiếm một đơn vị uy tín hãy xem ngay bài viết sau', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (978, 561, 'news', 'man', 'dich-vu', 'TOP đơn vị sửa chữa bảo dưỡng trạm biến áp uy tín Bình Dương', 'sửa chữa bảo dưỡng trạm biến áp', 'Khôi Việt Phát là một đơn vị sửa chữa bảo dưỡng trạm biến áp uy tín tại Bình Dương được nhiều khách hàng tin tưởng trong nhiều năm qua. Xem ngay.', NULL, NULL, NULL, NULL, NULL);
