INSERT INTO `table_seo` VALUES (980, 563, 'news', 'man', 'dich-vu', 'Gợi ý cho bạn đơn vị chuyên bảo dưỡng trạm biến áp định kỳ', 'chuyên bảo dưỡng trạm biến áp định kỳ', 'Khôi Việt Phát là một đơn vị có nhiều năm kinh nghiệm trong việc chuyên bảo dưỡng trạm biến áp định kỳ được nhiều khách hàng tin tưởng và lựa chọn.', NULL, NULL, NULL, NULL, NULL);
