INSERT INTO `table_seo` VALUES (1289, 863, 'news', 'man', 'tin-tuc', 'Trạm biến áp 110kV và lợi ích của nó là gì?', 'Trạm biến áp 110kV và lợi ích của nó là gì?', 'Bài viết dưới đây, chúng tôi sẽ giúp bạn tìm hiểu chi tiết về trạm biến áp 110kV cũng như địa chỉ uy tín để tìm mua trạm biến áp chất lượng và uy tín.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1290, 864, 'news', 'man', 'tin-tuc', 'Trạm biến áp hợp bộ kiểu đứng là gì?', 'Trạm biến áp hợp bộ kiểu đứng là gì?', 'Trạm biến áp hợp bộ kiểu đứng (Trạm biến áp một cột, trạm trụ một cột) là loại trạm trong đó máy biến áp được đặt trên một trụ thép đơn hoặc trụ bằng cột bê tông ly tâm.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1291, 865, 'news', 'man', 'tin-tuc', 'Vai trò và chức năng của trạm biến áp', 'Vai trò và chức năng của trạm biến áp', 'Trạm biến áp là một trong những bộ phận quan trọng trong một hệ thống cung cấp điện. Như chúng đã biết thì trạm biến áp được dùng để thay đổi điện năng sao cho phù hợp với hệ thống điện.', NULL, NULL, NULL, NULL, NULL);
