INSERT INTO `table_seo` VALUES (1293, 867, 'news', 'man', 'tin-tuc', 'Những điều cần lưu ý khi bảo trì trạm biến áp bạn cần biết', 'bảo trì trạm biến áp', 'Bảo trì trạm biến áp hiện đang là vấn đề được rất nhiều người quan tâm. Bởi chỉ khi trạm biến áp hoạt động tốt thì nguồn điện được truyền tải đến những nơi tiêu thụ mới có thể hoạt động với công suất ', NULL, NULL, NULL, NULL, NULL);
