INSERT INTO `table_seo` VALUES (1415, 79, 'news', 'man', 'dich-vu', 'Lắp đặt tủ điện hạ thế chuyên nghiệp tại Bình Dương', 'Tủ điện hạ thế', 'Tủ điện hạ thế là thiết bị chứa đựng và điều khiển điện không thể thiếu trong công nghiệp\r\nTủ điện hạ thế được sản xuất cung cấp bởi Khôi Việt Phát, luôn có chất lượng ổn định. Giá luôn rẻ hơn thị trư', NULL, NULL, NULL, NULL, NULL);
