INSERT INTO `table_seo` VALUES (1704, 1, 'product', 'man', 'san-pham', 'THI CÔNG HỆ THỐNG PHÒNG CHÁY CHỮA CHÁY', 'thi cong phong chay chua chay gia re , thi cong he thong phong chay chua chay , thi công phòng cháy chữa cháy , thi công hệ thống phòng cháy chữa cháy ', 'Thi công hệ thống phòng cháy chữa cháy giá rẻ là một trong những dịch vụ được khách hàng của công ty Khôi Việt Phát lựa chọn rất nhiều về độ lành nghề cũng như đội ngũ chuyên nghiệp của thợ mang lại ', '', '', '', '', '');
INSERT INTO `table_seo` VALUES (1638, 2, 'product', 'man', 'san-pham', 'báo giá thi công cơ điện M&E Tại Bình Dương', 'Báo giá thi công cơ điện M&E Bình Dương , bao gia thi cong co dien M&E Binh Duong', 'Công ty Khôi Việt Phát chuyên báo giá thi công cơ điện M&E Tại Bình Dương với giá cạnh tranh và chất lượng uy tín . Liên hệ ngay : 0934 620 879 để được tư vấn và báo giá tốt nhất cho nhu cầu của bạn .', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1639, 3, 'product', 'man', 'san-pham', 'Thi công hệ thống điện nhà xưởng Bình Dương', 'thi công hệ thống điện nhà xưởng bình dương', 'thi công hệ thống điện nhà xưởng bình dương là một trong những hạng mục được công ty Khôi Việt Phát phát triển mạnh về bề dày cũng như độ lành nghệ của đội ngũ thợ uy tín chuyên nghiệp .', NULL, NULL, NULL, NULL, NULL);
