INSERT INTO `table_seo` VALUES (1679, 162, 'news', 'man', 'tin-tuc', 'Tìm hiểu tất tần tật về tủ điện công nghiệp', 'cơ điện khôi việt phát , co dien khoi viet phat , thi công điện bình dương , thi cong dien binh duong , thi công hệ thống điện , lắp đặt hệ thống điện , thi công hệ thống điện nhà xưởng , lắp đặt hệ thống điện nhà xưởng, thi công hệ thống điện, sản xuất tủ điện, báo giá tr điện tại bình dương, chuyên thi công điện nhà xưởng, thi công hệ thống điện nước ', 'Hiện nay tủ điện là một sản phẩm không thể thiếu trong mỗi hộ gia đình hay các nhà máy, xí nghiệp. Dù là tủ điện công nghiệp hay tủ điện dân dụng thì chúng đều có những vai trò vô cùng quan trọng.', NULL, NULL, NULL, NULL, NULL);
