INSERT INTO `table_seo` VALUES (1855, 314, 'news', 'man', 'tin-tuc', 'Inox có sơn được không? Inox sơn tĩnh điện?', '', 'Inox là một loại hợp kim thép mà trong đó có hàm lượng theo khối lượng của carbon nhiều nhất là 1,2%, hàm lượng crôm ít nhất là 10,5%.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1856, 315, 'news', 'man', 'tin-tuc', 'So sánh inox 201 và 304 Nên Sử Dụng Inox Nào Cho Hợp Lý', '', 'Inox 304 và Inox 201 là 2 loại inox được sử dụng nhiều trong cơ khí. Các bạn thắc mắc inox 304 và inox 201 có ưu và nhược điểm gì?', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1857, 316, 'news', 'man', 'tin-tuc', 'MẸO LÀM SẠCH BẾP CÔNG NGHIỆP SỬ DỤNG HIỆU QUẢ HƠN', '', 'Độ bền của thiết bị bếp công nghiệp không chỉ phụ thộc vào cách sử dụng mà còn ở việc bạn vệ sinh bếp như thế nào?', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1858, 317, 'news', 'man', 'tin-tuc', 'Các tiêu chí để chọn thiết bị bếp công nghiệp chính hãng', '', 'Thiết bị bếp công nghiệp inox đóng vai trò rất quan trọng trong hoạt động của nhà bếp, xong việc chọn lựa và đặt mua các thiết bị nhà bếp công nghiệp không phải là điều đơn.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1859, 318, 'news', 'man', 'tin-tuc', 'LƯU Ý KHI THỰC HIỆN GIA CÔNG INOX', '', 'Sau đây là một số lưu ý trong quá trình gia công inox mà người thợ cần nắm bắt được để có thể cho ra những sản phẩm có tính ứng dụng cao, đáp ứng được tiêu chuẩn về chất lượng cũng như về mặt thẩm mỹ.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1860, 319, 'news', 'man', 'tin-tuc', 'LƯU Ý QUAN TRỌNG CẦN NHỚ KHI SỬ DỤNG INOX', '', 'Tuy nhiên môi trường nhà bếp với nhiều nhiệt độ và độ ẩm cao cùng nhiều dầu mỡ dễ làm ảnh hưởng đến độ bền đẹp của thiết bị. Trong bài viết này Hiền Phương sẽ lưu ý bạn khi sử dụng thiết bị bằng inox trong nhà bếp.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1861, 320, 'news', 'man', 'tin-tuc', 'NHỮNG LỢI ÍCH VƯỢT TRỘI KHI SỬ DỤNG INOX CHO PHÒNG BẾP', '', 'Việc sử dụng thiết bị inox vừa tiện lợi và mang đến nhiều lợi ích. Sau đây là những lợi ích của việc sử dụng thiết bị inox trong bếp công nghiệp.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1862, 321, 'news', 'man', 'tin-tuc', 'INOX LÀ GÌ? THÀNH PHẦN VÀ NGUỒN GỐC CỦA INOX', '', 'Inox (hay thép không gỉ, thép trắng) là một dạng hợp kim của sắt, ít bị ăn mòn, ít bị biến màu hơn so với các loại thép bởi trong thành phần chất hóa học Crom chứa ít nhất 10,5%.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1863, 322, 'news', 'man', 'tin-tuc', 'PHÂN BIỆT SỰ KHÁC NHAU GIỮA INOX 304 VỚI INOX 201', '', 'Nhiều người vẫn chưa phân biệt được sự khác nhau giữa hai loại thép không gỉ này. Hãy tham khảo bài viết sau để tìm ra được điểm khác biệt giữa inox 304 và inox 201 nhé!', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1864, 323, 'news', 'man', 'tin-tuc', 'Bí quyết sử dụng và bảo về đồ dùng inox đúng cách như thế nào?', '', 'Bí quyết sử dụng đồ dùng inox đúng cách. Giúp tăng độ bền các đồ dùng trong gia đình bạn một cách bất ngờ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1865, 324, 'news', 'man', 'tin-tuc', 'Khi gia công vật liệu inox thì yêu cầu những gì?', '', 'Gia công inox là toàn bộ các công việc từ thiết kế, chế tạo cho tới sản xuất hàng loạt các sản phẩm bằng chất liệu inox theo yêu cầu của khách hàng', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1866, 325, 'news', 'man', 'tin-tuc', 'Những lợi ích vượt trội của bàn ghế inox căn tin', '', 'Ngày nay, việc sử dụng các thiết bị bàn ghế bằng chất liệu inox ngày càng phổ biến hơn', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1867, 326, 'news', 'man', 'tin-tuc', 'Inox được phát hiện ra như thế nào?', '', 'Năm 1913, Harry Brearley – một chuyên gia về thép đã tìm ra vật liệu hữu ích này bằng cách giảm tỉ lệ carbon và tăng tỉ lệ crom trong thành phần kim loại.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1868, 327, 'news', 'man', 'tin-tuc', 'Trào lưu sử dụng đồ dùng inox ngày càng tăng cao', '', 'Inox ngày càng được sử dụng rộng rãi với đa dạng các mục đích khác nhau, từ inox làm cổng, lan can cho tới inox trang trí', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1869, 328, 'news', 'man', 'tin-tuc', 'Sử dụng đúng các thiết bị, dụng cụ nấu nướng bằng inox như thế nào để bảo vệ sức khỏe', '', 'Người tiêu dùng đã rất quen thuộc với các thiết bị gia dụng, thiết bị bếp công nghiệp và bếp nhà hàng làm bằng inox', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1870, 329, 'news', 'man', 'tin-tuc', 'Các loại inox được sử dụng để làm đồ dùng nhà bếp', '', 'Inox là hỗn hợp các kim loại như Niken, Crom, Đồng, Sắt, Carbon, Mangan, Silic… nên độ bền của inox cũng phụ thuộc vào việc pha trộn các hợp kim này nhiều hay ít.\n\n', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1871, 330, 'news', 'man', 'tin-tuc', 'Hướng dẫn bảo quản đồ gia dụng inox', '', 'Về chất liệu inox, hiện nay sử dụng phổ biến là chất liệu inox 201 và 304. Trong đó, chất liệu inox 304 chủ yếu được sử dụng cho các sản phẩm dùng ngoài trời hoặc các sản phẩm an toàn thực phẩm.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1872, 331, 'news', 'man', 'tin-tuc', 'CÁCH LÀM SẠCH VÀ ĐÁNH BÓNG ĐỒ INOX HIỆU QUẢ NHẤT', '', 'Inox có nhiều ưu điểm nổi bật nên được ưa chuộng để sử dụng làm vật liệu xây dựng và các đồ dùng trong gia đình như: Bàn inox, ghế, kệ inox,... ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1873, 332, 'news', 'man', 'tin-tuc', 'Hướng dẫn những cách đánh bóng bàn ghế inox bằng tay tại nhà', '', 'Bàn ghế inox là vật dụng phục vụ hàng đầu cho các nhà rạp đám cưới, bàn ghế ăn trong gia đình cũng như ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1874, 333, 'news', 'man', 'tin-tuc', 'Mẫu Kệ Chén Inox Đẹp Tiện Dụng Nhất Hiện Nay', '', 'Kệ đựng chén dĩa hiện nay là một vật dụng quan trọng, đựng chén, bát, dĩa muỗng… phục vụ cho nhu cầu ăn uống của từng thành viên. Lý do nào khiến kệ chén inox luôn chiếm được sự quan tâm và là ưu tiên số một của các bà nội trợ.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1875, 334, 'news', 'man', 'tin-tuc', 'Giải pháp về phụ kiện inox thông minh', '', 'Các giải pháp về phụ kiện inox hay còn gọi là biện pháp giúp các gia chủ tận dụng tối đa diện tích bếp một cách thông minh nhất. Bạn có thể tham khảo về các kiểu phụ kiện inox dưới đây và chọn ra phương án phù hợp nhất với nhu cầu của gia đình mình.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1876, 335, 'news', 'man', 'tin-tuc', 'Top 3 Mẫu Kệ Inox Đang Được Ưa Chuộng Hiện Nay', '', ' Với ưu điểm bền đẹp, giá thành rẻ, các mẫu kệ inox ngày càng có vai trò không thể thiếu trong đời sống. Cùng xem những mẫu kệ inox đang được ưa chuộng nhất hiện nay.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1877, 336, 'news', 'man', 'tin-tuc', 'Bí Quyết Giúp Vật Dụng Inox Luôn Sáng Như Mới', '', 'inox có khả năng chống gỉ, chịu nhiệt cao mà bạn lại chủ quan không lo bảo quản chu đáo, điều này sẽ gây ảnh hưởng xấu và tác động trực tiếp vào inox chắc chắn inox sẽ bị đổi màu hoặc có thể bị ố cho nên bạn cần lưu ý.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1878, 337, 'news', 'man', 'tin-tuc', 'Mẫu Kệ Inox Treo Tường Tiết Kiệm Không Gian', '', 'Với thiết kế treo tường tiện dụng cùng nhiều kiểu dáng màu sắc khác nhau. Không khó để loại kệ treo tường này thu hút thị hiếu của người dùng. Dưới đây là một số mẫu kệ treo tường đang được ưa chuộng hiện nay.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1879, 338, 'news', 'man', 'tin-tuc', 'Mỹ sẽ áp thuế chống bán phá giá inox nhập khẩu từ Trung quốc, Nhật bản', '', 'Bộ Thương mại Mỹ đã xác định biên độ phá giá mặt hàng inox cuộn cán nguội nhập khẩu từ Trung Quốc và Nhật Bản, qua đó phát đi tín hiệu Mỹ có thể áp ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1880, 339, 'news', 'man', 'tin-tuc', 'Việt Nam tiếp tục áp thuế chống bán phá giá inox', '', 'Bộ Công Thương vừa ban hành Quyết định số 1656/QĐ-BCT về kết quả rà soát lần thứ nhất việc áp dụng biện pháp chống bán phá đối với một số sản phẩm ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1881, 340, 'news', 'man', 'tin-tuc', 'Giá inox cao nhưng đây là sự đầu tư chính đáng cho doanh nghiệp', '', 'Nhiều người trong ngành nhà hàng hay sản xuất sản phẩm công nghiệp hiện đang bùng nổ mạnh mẽ không ngừng tự hỏi nên sử dụng vật liệu inox hay không.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1882, 341, 'news', 'man', 'tin-tuc', 'Inox là gì? Những điều cần biết về inox', '', 'Inox hay còn có tên gọi khác là thép không gỉ là kim loại có độ bền cực cao nhưng inox còn phụ thuộc vào việc pha trộn tỉ lệ các hợp kim với nhau theo các tỉ ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1883, 342, 'news', 'man', 'tin-tuc', 'Cách sử dụng đúng các thiết bị, dụng cụ nấu nướng bằng inox', '', 'Người tiêu dùng đã rất quen thuộc với các thiết bị gia dụng, thiết bị bếp công nghiệp và bếp nhà hàng làm bằng inox.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1884, 343, 'news', 'man', 'tin-tuc', 'LÔ HÀNG INOX CÔNG NGHIỆP MỚI CẬP BẾN ĐẾN CHO CÔNG TY NHỰA HƯNG PHÁT', '', '', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1885, 344, 'news', 'man', 'tin-tuc', 'Cách Bảo Quản Và Làm Mới Thiết Bị Inox Đơn Giản, Hiệu Quả', 'thiết bị inox', 'Bất cứ thiết bị, sản phẩm inox nào cũng đều có nguyên tắc, quy trình bảo quản của riêng. Cùng tìm hiểu ở bài viết này nhé!', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1886, 345, 'news', 'man', 'tin-tuc', 'Cách Bảo Quản Lan Can, Cầu Thang Inox Không Bị Han Gỉ', 'lan can, cầu thang inox', 'Đây là bài viết tổng hợp những cách bảo quản lan can, cầu thang làm bằng inox không bị han gỉ mà bạn cần biết.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1887, 346, 'news', 'man', 'tin-tuc', 'Cách Bảo Quản Thiết Bị Inox Công Nghiệp Bạn Cần Biết', 'inox công nghiệp', 'Bài viết sau đây sẽ cung cấp đến các bạn cách thức bảo quản các thiết bị inox công nghiệp có trong gian bếp xinh xắn của mình.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1888, 347, 'news', 'man', 'tin-tuc', '5 Lý Do Nên Chọn Phụ Kiện Inox 304 Cho Căn Bếp Và Phòng Tắm', 'inox 304', 'Inox 304 là một loại Inox phổ biến và được ưa chuộng nhất. Hãy cùng Hiền Phương tìm hiểu vì sao Inox 304 lại được ưa chuộng như vậy nhé!', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1889, 348, 'news', 'man', 'tin-tuc', 'Lưu Ý Khi Chọn Nội Thất Làm Bằng Inox 304 Bạn Cần Biết', 'inox 304', 'Bài viết này là những lưu ý khi chọn nội thất làm bằng inox 304 mà bạn cần biết do Hiền Phương tổng hợp và đúc kết lại.  ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1890, 349, 'news', 'man', 'tin-tuc', '4 Điều Cơ Bản Về Inox (Thép Không Gỉ) Mà Bạn Cần Biết', 'inox', 'Inox là gì? Inox có bị ăn mòn không? Bài viết này sẽ cho bạn biết một số thông tin cơ bản về Inox (thép không gỉ). XEM THÊM!', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1891, 350, 'news', 'man', 'tin-tuc', 'Ứng Dụng Của Inox Trong Cuộc Sống Bạn Cần Biết', 'inox', 'Inox ngày càng phổ biến và được ứng dụng rất nhiều trong cuộc sống của mỗi chúng ta. Vậy những ứng dụng đó là gì? XEM THÊM!  ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1892, 351, 'news', 'man', 'tin-tuc', 'Những Ưu Điểm Nổi Bật Của Thiết Bị Gia Công Inox', 'thiết bị gia công inox', 'Tại sao thiết bị gia công inox lại đang trở thành xu thế? Bài viết này chúng tôi sẽ cung cấp đến bạn đọc những ưu điểm của nó.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1893, 352, 'news', 'man', 'tin-tuc', 'Cách Giữ Gìn Chậu Rửa Inox Luôn Bền Đẹp', 'chậu rửa inox', 'Chậu rửa inox là một trong những thiết bị, đồ dùng quan trọng trong nhà bếp. Hãy cùng tìm hiểu cách để chậu rửa inox có tuổi thọ cao nhé! ', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1894, 353, 'news', 'man', 'tin-tuc', '5 Ưu Điểm Vượt Trội Khi Dùng Thiết Bị Inox Trong Bếp Công Nghiệp', 'thiết bị inox', 'Bài viết giới thiệu những lợi ích việc sử dụng thiết bị inox trong công nghiệp. Hi vọng cung cấp cho người đọc những thông tin bổ ích nhất.', NULL, NULL, NULL, NULL, NULL);
