INSERT INTO `table_static` VALUES (5, 'jeremy-bishop-dvacrxuexls-unsplash-9187.jpg', '', '[]', 'gioi-thieu', '', '', '&lt;p&gt;CÔNG TY TNHH KỸ THUẬT CƠ ĐIỆN KHÔI VIỆT PHÁT&lt;br /&gt;\r\nĐược thành lập vào ngày: 13 tháng 12 năm 2012. Do sở kế hoạch và đầu tư tỉnh Bình Dương cấp phép. Với vốn điều lệ 3.500.000.000 ( Ba tỷ năm trăm triệu đồng)&lt;br /&gt;\r\nCông Ty KHÔI VIỆT PHÁT là một trong những đơn vị chuyên nghiệp, uy tín hàng đầu Việt Nam hoạt động trong các lĩnh vực như:&lt;br /&gt;\r\n- Tư vấn thiết kế, thi công hệ thống cơ điện, , cho nhà xưởng,nhà văn phòng, chung cư, nhà cao tầng, trường học, bệnh viện…&lt;br /&gt;\r\n- Thiết kế, sản xuất các loại tủ điện phân phối,tủ điện chống mất pha, tủ điều khiển, tủ bu, .&lt;br /&gt;\r\n- Thiết kế thi công hệ thống chữa cháy, báo cháy tự động..&lt;br /&gt;\r\n- Thiết kế, lắp đặt các hệ thống chống sét đánh thẳng, chống sét lan truyền và thiết bị điện, cung cấp dịch vụ lắp đặt, bảo trì, bảo dưỡng, tư vấn thiết kế các giải pháp, giám sát thi công, đo kiểm .v.v. về các hệ thống tiếp đất, chống sét, chống nhiễu, cân bằng điện thế &amp; che chắn điện từ.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nKhôi Việt Phát là đơn vị thi công đáng tin cậy cho mọi công trình với đội ngũ cán bộ, nhân viên kỹ thuật có trình độ tay nghề cao, năng động và đầy sáng tạo. Bộ máy quản lý phân quyền tạo ra tính độc lập sáng tạo, trách nhiệm trong công việc trong mỗi thành viên trong công ty.&lt;br /&gt;\r\nTrong thời gian qua, công ty không ngừng nổ lực phát triển, nâng cao trình độ kỹ thuật, nghiệp vụ để bắt kịp với nhịp độ phát triển của xã hội. công ty luôn chú trọng đến việc phát triển nguồn nhân lực với trình độ cao, cũng như đầu tư trang thiết bị hiện đại phục vụ trong công việc.&lt;br /&gt;\r\nVới kinh nghiệm và năng lực của mình, Công Ty Khôi Việt Phát cam kết mang đến cho quý khách hàng sự hài lòng tối đa về chất lượng công trình, đúng tiến độ với giá thành hợp lý nhất.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Thông tin công ty&lt;/strong&gt;&lt;br /&gt;\r\n- Tên giao dịch: CÔNG TY TNHH KỸ THUẬT CƠ ĐIỆN KHÔI VIỆT PHÁT&lt;br /&gt;\r\n- Tên tiếng hoa: 技術-機電恢越發責任有限公司&lt;br /&gt;\r\n- Địa chỉ: Số 5T/10M, Kp Bình Thuận 2, Thuận Giao, Thuận An, Bình Dương&lt;br /&gt;\r\n- Điện thoại:0934 620 879&lt;br /&gt;\r\n- Email:khoivietphat@gmail.com&lt;br /&gt;\r\n- Website:codienbinhduong.com&lt;br /&gt;\r\n- Giấy phép thành lập số: 3702136173 cấp ngày 13 tháng 12 năm 2012&lt;br /&gt;\r\n- Mã số thuế:3702136173&lt;br /&gt;\r\n- Tài khoản ngân hàng số: 151997059Tại ngân hàng: ACB-CN Bình Dương&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n', '', 'Khôi Việt Phát là đơn vị thi công đáng tin cậy cho mọi công trình với đội ngũ cán bộ, nhân viên kỹ thuật có trình độ tay nghề cao, năng động và đầy sáng tạo. Bộ máy quản lý phân quyền tạo ra tính độc lập sáng tạo, trách nhiệm trong công việc trong mỗi thành viên trong công ty. Trong thời gian qua, công ty không ngừng nổ lực phát triển, nâng cao trình độ kỹ thuật, nghiệp vụ để bắt kịp với nhịp độ phát triển của xã hội. công ty luôn chú trọng đến việc phát triển nguồn nhân lực với trình độ cao, cũng như đầu tư trang thiết bị hiện đại phục vụ trong công việc. Với kinh nghiệm và năng lực của mình, Công Ty Khôi Việt Phát cam kết mang đến cho quý khách hàng sự hài lòng tối đa về chất lượng công trình, đúng tiến độ với giá thành hợp lý nhất.', '', 'Giới Thiệu', '', 'gioi-thieu', 'hienthi', 1690862559, '', 1693208554);
